function stronglySent(n){buildBindings();$.post(n,JSON.stringify(stronglyData),n=>console.log(n),"json")}function buildBindings(){var n,t,i;for(n in stronglyData.bindings)t=$('[binding-key="'+n+'"]'),t.length>0&&(i={},$.each(t.serializeArray(),function(){i[this.name]=this.value}),stronglyData.bindings[n].data=JSON.stringify(i))}